css:
.keymap-generator {
  display: flex;
  flex-direction: column;
  padding: 1.5em;
  font-size: 1em;
  color: #444444;
  background-color: #f4f4f4;
  overflow-x: auto;
}
.keymap-generator .header {
  flex-shrink: 0;
}
.keymap-generator .header .title {
  font-size: 1.7em;
}
.keymap-generator .keys-events-panel {
  flex-shrink: 0;
  display: flex;
  flex-direction: row;
  margin-bottom: 1em;
}
.keymap-generator .keys-events-panel .key-box {
  diplay: flex;
  flex: 1;
  padding: 1em;
  border: 1px solid #9f9f9f;
  background-color: rgba(0, 0, 0, 0.1);
  border-radius: 2px;
  margin-right: 1em;
}
.keymap-generator .keys-events-panel .key-box .section-heading {
  margin-bottom: 1em;
}
.keymap-generator .keys-events-panel .key-box .key-attribute-row {
  display: flex;
  flex-direction: row;
}
.keymap-generator .keys-events-panel .key-box .key-attribute-row * {
  display: flex;
  flex: 1;
}
.keymap-generator .keys-events-panel .key-box:last-child {
  margin-right: 0;
}
.keymap-generator .modifier-bar-panel {
  display: flex;
  flex-shrink: 0;
  flex-direction: row;
  margin-bottom: 1em;
}
.keymap-generator .modifier-bar-panel .modifier {
  flex: 1;
  padding: 1em;
  border: 1px solid #9f9f9f;
  text-align: center;
  background-color: rgba(0, 0, 0, 0.1);
  border-radius: 2px;
  margin-right: 1em;
}
.keymap-generator .modifier-bar-panel .modifier:last-child {
  margin-right: 0;
}
.keymap-generator .modifier-bar-panel .modifier-active {
  background-color: #888888;
  color: #ffffff;
}
.keymap-generator .key-input-panel {
  margin-bottom: 1em;
  display: flex;
  flex-shrink: 0;
  flex-direction: column;
  align-items: stretch;
}
.keymap-generator .key-input-panel .key-label {
  color: #999999;
  margin-bottom: 0.3em;
}
.keymap-generator .key-input-panel .key-input {
  background-color: #ffffff;
  border: 1px solid rgba(159, 159, 159, 0.9);
  border-radius: 2px;
  padding: 3px 0px 3px 10px;
  font-weight: normal;
  font-size: 17px;
  color: #444444;
}
.keymap-generator .key-input-panel .key-input:focus {
  padding: 2px 0px 2px 10px;
  border: 2px solid #888888;
}
.keymap-generator .test-key-panel {
  margin-bottom: 1em;
  display: flex;
  flex-shrink: 0;
  flex-direction: column;
  align-items: stretch;
  justify-content: space-around;
}
.keymap-generator .test-key-panel .test-key-label {
  color: #999999;
  margin-bottom: 0.3em;
}
.keymap-generator .test-key-panel .test-key-input {
  background-color: #ffffff;
  border: 2px solid rgba(159, 159, 159, 0.9);
  border-radius: 2px;
  padding: 2px;
}
.keymap-generator .test-key-panel .test-key-input:focus {
  border: 2px solid #888888;
}
.keymap-generator .map-table-panel {
  padding: 1em;
  border: 1px solid #9f9f9f;
  background-color: rgba(0, 0, 0, 0.1);
  border-radius: 2px;
  overflow-x: auto;
}
.keymap-generator .map-table-panel .map-table {
  clear: both;
}
